import React from "react";
import s from './Profile.module.css';
import MyPosts from "./MyPosts/MyPosts";
import ProfileInfo from "./ProfileInfo/ProfileInfo";

const Profile = (props) => {

    return  <div >
      <ProfileInfo/>
        <MyPosts posts={props.posts} newPostText={props.newPostText}  updateNewTekstPost={props.updateNewTekstPost} addPost={props.addPost}/>

    </div>
}

export default Profile
